export default {
    userId(state) {
      return state.auth.userId;
    },
    token(state) {
      return state.auth.token;
    },
    isAuthenticated(state) {
      return !!state.auth.token;
    },
    didAutoLogout(state) {
      return state.auth.didAutoLogout;
    }
  };
